import { Avatar, Button, Container, CssBaseline, Grid, makeStyles, TextField, Typography } from "@material-ui/core";
import { Lock, Mic } from "@material-ui/icons";
import React from "react";
import NavBar from "./Navbar";
import Navbar from './Navbar'

const useStyles = makeStyles((theme) => ({


    paper: {
      marginTop: theme.spacing(8),
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
    },
 
    form: {
      width: '100%', // Fix IE 11 issue.
      marginTop: theme.spacing(3),
    },
    avatar: {
        margin: theme.spacing(1),
        backgroundColor: "#000000",
        padding:'20px'
      },
    submit: {
      margin: theme.spacing(3, 0, 2),
     backgroundColor:theme.palette.secondary.main,
      '&:hover': {
          background: theme.palette.secondary.light,
        
       },
    },
  }));
  

export default function CreateRoom(){

    const roomnameRef = React.useRef()

    const handlesubmit=(e)=>{
        e.preventDefault()
        console.log(roomnameRef)
    }

    const classes = useStyles();
    return(
        <div>
        <NavBar/>
        <Container component="main" maxWidth="xs">
           <CssBaseline />
           <div className={classes.paper}>
           <Avatar className={classes.avatar}>
          <Mic />
        </Avatar>
             <Typography component="h1" variant="h5">
               Let's Create Episode on Builder....
             </Typography>
             <form className={classes.form} onSubmit={handlesubmit}  noValidate>
               <Grid container spacing={2}>
     
                 <Grid item xs={12}>
                   <TextField
                     variant="outlined"
                     inputRef={roomnameRef}
                     required
                     fullWidth
                     id="roomname"
                     label="Room Name"
                     name="roomname"
                     autoComplete="off"
                   />
                 </Grid>
                
                 
                 
               </Grid>
               <Button
                 type="submit"
                 fullWidth
                 variant="contained"
                 color="primary"
                 className={classes.submit}
               >
                 create
               </Button>
              
             </form>
           </div>
          
         </Container>
         </div>
    )
}
